    in the database regarding technologies being developed for capture, evaluation of
    sites for carbon dioxide (CO2) storage, estimation of project costs, and anticipated
    dates of completion is sourced from publically available information. The CCUS Database
    provides the public with information regarding efforts by various industries, public
    groups, and governments towards development and eventual deployment of CCUS technology.
